column32:
IDB is one of the most prominent business groups in Israel, which consists of IDB Development, Discount Investments and their respective subsidiaries. Each of the companies in IDB's portfolio is a leader in its industry, including Food Retail, Telecom, Insurance, Real estate, Agriculture, Tourism, Technology and Asset management. The Companies hold through their respective subsidiaries an aggregate a total of ca. USD 11.0 billion in assets, and employ more than 22,000 people within their wide and diverse portfolio of firms. 

IDB's strategy focuses on empowering innovation and technology in each of its subsidiaries to maintain a leadership position or to become a leader in its industry; We encourage development of existing areas and entering to new areas after identifying compelling opportunities.

IDB's main investments through IDB Development and Discount Investments (TASE: DISI) include the following companies: 
Clal Insurance Holdings (TASE: CLAL): one of the biggest insurance companies in Israel, with ca. USD 54 billion Assets under Management.
Shufersal, (TASE: SAE): The biggest food retailer in Israel with annual sales of ca. USD 3.4 billion through online and more than 300 stores;
Cellcom, (NYSE: CEL) (TASE: CEL): Israel's largest cellular operator, also offering other Telecommunication and TV services;
Property & Building, (TASE: PTBL) and Gav Yam (TASE: BYSD): Are two of the biggest real estate firms in the country, with assets in Israel and the US. They are also the biggest development companies of Tech Parks throughout the country;
Elron, (TASE: ELRN): Is a leading technology investment firm, focusing on the development of startups in early stages, primarily in the areas of Medical Device and Cybersecurity;
Mehadrin, (TASE: MEDN): The biggest producer and exporter of fruits and vegetables in Israel;
Israir, One of the leading low cost air lines in the local market;
Epsilon, an Asset management firm, focusing on Wealth management and underwriting services;
